(45, 'bakchos@olympos.gr', 'Dionysos', 'dithyrambos', 'm', 'm', '1990-01-01', 'Olympus', 'Born out of the thigh of my father, Zeus, after my mother Semele died. Proven myself to be worthy of being on Olympus by conquering the world with wine and triumphing over death. Live to party. Very extrovert and outgoing. Great love for art, poetry and can beat you at any drinking competition. I can give you the courage you need. If you make a peace offering to me I will tell you what your future brings  F0 9F 98 89', '1990-05-05', '2010-05-05'),
